import { stringify } from "querystring";
import { useEffect, useState } from "react";
import TypeChecker from "../../../contents/js/validation";
// import { TypeChecker } from "../../../contents/js/validation";

const UserInsert = () => {
  useEffect(() => {
    // const script = document.createElement("script");
    // script.src = require("@contents/js/validation.js");
    // script.async = true;
    // document.body.appendChild(script);
  });
  const [values, setValues] = useState({
    userId: "",
    userPw: "",
    userNm: "",
    pno: "",
    emailAddr: "",
    mblPno: "",
  });
  const handleChange = (e: any) => {
    setValues({
      ...values,
      [e.target.name]: e.target.value,
    });
  };
  const userInsertProc = (e: any) => {
    if (!values.userId) {
      alert("아이디를 입력하세요");
      return;
    }
    if (!values.userPw) {
      alert("패스워드를 입력하세요");
      return;
    }
    if (!TypeChecker.email(values.emailAddr)) {
      alert("이메일은 " + TypeChecker.emailText);
      return;
    }
    alert(JSON.stringify(values, null, 2));
    //e.preventDefault();
  };
  const validate = (values: any) => {
    let errors: any = {};
    if (!values.userId) {
      errors.userId = "아이디를 입력하세요";
    }
    if (!values.userPw) {
      errors.userPw = "비밀번호를 입력하세요";
    }
    if (!TypeChecker.email(values.emailAddr)) {
      alert("이메일은 " + TypeChecker.emailText);
      return;
    }
  };
  return (
    <form onSubmit={userInsertProc}>
      <div className="contents">
        <p className="contentTitle">사용자 목록</p>
        <p className="sub_path">
          <img
            src={require("@contents/images/ico_home.png")}
            width={10}
            height={9}
          />
          &nbsp;〉&nbsp;사용자관리&nbsp;〉&nbsp;사용자관리
        </p>
        <h4 className="contentTitle_h4">로그인 정보</h4>
        <div className="tableLayer">
          <table className="table">
            <caption />
            <colgroup>
              <col width="150px" />
              <col width="340px" />
              <col width="150px" />
              <col width="340px" />
            </colgroup>
            <tbody className="line">
              <tr>
                <th>아이디</th>
                <td>
                  <div className="commonSearch_wrap">
                    <label className="blind" htmlFor=" ">
                      d
                    </label>
                    <input
                      name="userId"
                      style={{ width: "320px" }}
                      type="text"
                      placeholder="test"
                      value={values.userId}
                      onChange={handleChange}
                    />
                  </div>
                </td>
                <th className="bullet_orange">패스워드</th>
                <td>
                  <div className="commonSearch_wrap">
                    <label className="blind" htmlFor=" ">
                      d
                    </label>
                    <input
                      name="userPw"
                      style={{ width: "320px" }}
                      type="password"
                      value={values.userPw}
                      onChange={handleChange}
                    />
                  </div>
                </td>
              </tr>
              <tr></tr>
            </tbody>
          </table>
        </div>
        <h4 className="contentTitle_h4">개인 정보</h4>
        <div className="tableLayer">
          <table className="table">
            <caption />
            <colgroup>
              <col width="150px" />
              <col width="340px" />
              <col width="150px" />
              <col width="340px" />
            </colgroup>

            <tbody className="line">
              <tr>
                <th className="bullet_orange">이름</th>
                <td>
                  <div className="commonSearch_wrap">
                    <label className="blind" htmlFor=" ">
                      d
                    </label>
                    <input
                      name="userNm"
                      style={{ width: "320px" }}
                      type="text"
                      placeholder="test"
                      value={values.userNm}
                      onChange={handleChange}
                    />
                  </div>
                </td>
                <th>전화번호</th>
                <td>
                  <div className="commonSearch_wrap">
                    <label className="blind" htmlFor=" ">
                      d
                    </label>
                    <input
                      name="pno"
                      style={{ width: "320px" }}
                      type="text"
                      placeholder="000-0000-0000"
                      value={values.pno}
                      onChange={handleChange}
                    />
                  </div>
                </td>
              </tr>
              <tr>
                <th>E-mail</th>
                <td>
                  <div className="commonSearch_wrap">
                    <label className="blind" htmlFor=" ">
                      d
                    </label>
                    <input
                      name="emailAddr"
                      style={{ width: "320px" }}
                      type="text"
                      value={values.emailAddr}
                      onChange={handleChange}
                    />
                  </div>
                </td>
                <th>휴대폰</th>
                <td>
                  <div className="commonSearch_wrap">
                    <label className="blind" htmlFor=" ">
                      d
                    </label>
                    <input
                      name="mblPno"
                      style={{ width: "320px" }}
                      type="text"
                      placeholder="000-0000-0000"
                      value={values.mblPno}
                      onChange={handleChange}
                    />
                  </div>
                </td>
              </tr>
            </tbody>
          </table>
        </div>
        <div className="T_btnLayer fr">
          <a href="#">
            <button type="submit" className="blueBtn L">
              등록
            </button>
          </a>
          <a href="#">
            <button type="button" className="blueBtn L">
              취소
            </button>
          </a>
        </div>
      </div>
    </form>
  );
};

export default UserInsert;
